import React from 'react';
import logo from './img/logo.png';
import './App.css';
import Header from './components/Header/Header';
import Navbar from './components/Navbar/Navbar';
import Leagues from './components/Leagues/Leagues';
import Teams from './components/Teams/Teams';
import LeagueSchedule from './components/Leagues/LeagueSchedule/LeagueSchedule';
import TeamSchedule from './components/Teams/TeamSchedule/TeamSchedule';

import { BrowserRouter, Route} from 'react-router-dom';

import { ReactComponent as LogoLeagues } from './img/league.png';
import { ReactComponent as LogoTeams } from './img/teams.png';
import { ReactComponent as LogoSchedule } from './img/schedule.png';

import  Periods  from './components/Periods/Periods'

const SECTIONS = [
    { title: 'Список лиг', component: Leagues, href: '/leagues', Icon: LogoLeagues },
    { title: 'Расписание лиги' , component: LeagueSchedule, href: '/leagueSchedule', Icon:LogoSchedule  },
    { title: 'Команды', component: Teams, href: '/teams', Icon: LogoTeams },
    { title: 'Расписание команды', component: TeamSchedule, href: '/teamSchedule', Icon: LogoSchedule },
  ];

const App = (props) => { 

    return(
      <BrowserRouter>    
        <div className="app-wrapper">
          <Header/> 
          <Navbar/>  
          <Periods period="2020"/>

          <div className="app-wrapper-content">
              <Route path='/leagues' render={ () => <Leagues /> }/>
              <Route path='/leagueSchedule' render={ () => <LeagueSchedule/>}/>
              <Route path='/teams' render={ () => <Teams/>}/>
              <Route path='/teamSchedule' render={ () => <TeamSchedule/>}/>
          </div>
        </div>
      </BrowserRouter>  
    );//return  

}//class

export default App;
